import React from "react";
const Form = () => {
  const styles = {
    label: {
      color: "#fff",
      fontSize: "2em",
    },
  };
  return (
    <div>

      <label htmlFor="fName">First Name</label>
      <input type="text" placeholder="Enter first name" id="fName" />
      <label htmlFor="lName">Last Name</label>
      <input type="text" placeholder="Enter last name" id="lName" />
    </div>
  );
};

export default Form;
